DATABASE_URL = env.database_url
default_engine = create_engine(DATABASE_URL)



def insert_records(records:list[dict], model_class:Type[SQLModel], engine=default_engine):
    """Populate table with test data."""

    with Session(engine) as session:
        # Insert record
        for record in records:
            instance = model_class(**record)
            session.add(instance)

        # Update ID sequence (only for PostgreSQL)
        if engine.url.get_backend_name() == 'postgresql':
            table_name = model_class.__tablename__
            session.exec(
                text(f"""SELECT setval(pg_get_serial_sequence(:table_name, 'id'), (SELECT MAX(id) FROM {table_name}));"""),
                {"table_name": table_name}
            )

        session.commit()

        print(f"{model_class.__name__} records inserted successfully!")



